# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.Views.View~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[RemoteAuthenticator]
  - - Django.Views.View~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[View]
  - - Django.db.models.Model~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[AbstractBaseUser]
  - - django.http.request.HttpRequest~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[HttpRequest]
  - - django.http.request.HttpRequest~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[Request]
  - - django.http.response.HttpResponseRedirect~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[HttpResponseRedirect]
  - - django.http.response.HttpResponse~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[HttpResponse]
  - - requests.models.Response~Subclass
    - aplus_auth
    - Member[requests].Member[Response]
  - - rest_framework.exceptions.APIException~Subclass
    - aplus_auth
    - Member[auth].Member[AuthenticationFailed]
  - - rest_framework.exceptions.APIException~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[AuthenticationFailed]
  - - rest_framework.exceptions.APIException~Subclass
    - aplus_auth
    - Member[exceptions].Member[AuthenticationFailed]
  - - rest_framework.request.Request~Subclass
    - aplus_auth
    - Member[auth].Member[django].Member[Request]
